import React from "react";
import Hello from "./Hello";



/**
 * Membuat Component Main
 */
function Main() {
  return (
    <div>
      <main>
        <Hello name="Fathimah" />
        <Hello name="Fatchan" />
        <Hello name="Wanandi" />
        <Hello name="Elbit" />
        <Hello name="Angga" />
      </main>
    </div>
  );
}

// export Component Main
export default Main;
